import {ScrollView,StyleSheet,Text} from "react-native"
export default function Insta(){
    return(<>
        <ScrollView style={{flex:"1",border:"1px solid red"}}>
            <Text style={styles.title}>name</Text>
        </ScrollView>
    </>)
}

const styles=StyleSheet.create({
    title:{
        fontWeight:"bold"
    }
})
